import { Bar } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

const chart = () => {

  return (
    <div>
      <Bar
        height={300}
        width={900}
        data={{
        labels:['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
        datasets:[{
          label:'Votes',
          data:[12,19,8,15,2,9],

        }]
        }} />
    </div>
  )
}

export default chart
